import React from "react";

const Weather = props =>(
    <div>
    {
        props.lattitude && props.lattitude && <p className="weather__key">Location: <span className="weather__value">{props.longitude} {props.lattitude}</span></p>
    }
    {
        props.temperature && <p className="waether__key">Temperature: <span className="weather__value">{props.temperature}</span></p>
    }
    
    {
        props.description && <p className="waether__key">Description: <span className="weather__value">{props.description}</span></p>
    }
    {
        props.wind && <p className="waether__key">Wind: <span className="weather__value">{props.wind}</span></p>
    }
    {
        props.error && <p className="waether__error">{props.error}</p>
    }
    </div>
);

export default Weather;
